import { ReactDOM } from 'react-dom';
import {HashRouter as Router,Routes,Route} from 'react-router-dom';
import App from './App';
import {adminRoutes,mainRoutes} from './routes'

ReactDOM.render(
<Router>
  <Routes>
    <Route path="/admin" element={<App/>}>

    </Route>
  </Routes>
</Router>,document.getElementById('root'));
